// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Charity {
    struct Donation {
        address donor;
        uint256 amount;
        uint256 timestamp;
    }

    Donation[] public donations;
    address public charityAddress;

    event Donated(address indexed donor, uint256 amount, uint256 timestamp);

    constructor(address _charityAddress) {
        charityAddress = _charityAddress;
    }

    function donate() external payable {
        require(msg.value > 0, "Donation must be greater than 0");

        donations.push(Donation({
            donor: msg.sender,
            amount: msg.value,
            timestamp: block.timestamp
        }));

        emit Donated(msg.sender, msg.value, block.timestamp);
    }

    function getDonationCount() external view returns (uint256) {
        return donations.length;
    }

    function getDonations() external view returns (Donation[] memory) {
        return donations;
    }

    function withdraw(uint256 amount) external {
        require(msg.sender == charityAddress, "Only charity can withdraw");
        require(address(this).balance >= amount, "Insufficient balance");

        payable(charityAddress).transfer(amount);
    }
}

